import { InputGroup, InputGroupText, Input } from "reactstrap";

function Position({triggers, index}) {
    return (
        <>
            <h3>Position</h3>
            <InputGroup size="sm">
                <InputGroupText>X</InputGroupText>
                <Input placeholder={triggers[index].Position[0]}></Input>
            </InputGroup>
            <br />
            <InputGroup>
                <InputGroupText>Y</InputGroupText>
                <Input placeholder={triggers[index].Position[1]}></Input>
            </InputGroup>
            <br />
            <InputGroup>
                <InputGroupText>Z</InputGroupText>
                <Input placeholder={triggers[index].Position[2]}></Input>
            </InputGroup>

        </>
    );
}

export default Position;
